import React from "react";
import { Button } from "react-bootstrap";

const MyButton = props => (
  <Button
    variant="danger"
    size="lg"
    block
    disabled={props.disabled}
    type="submit"
    className="button login-form-submit"
  >
    Valider
  </Button>
);

export default MyButton;
